import React,{useState} from "react";

export default function InputField(props)
{
    return (
        <div>
            <input 
                    type={props.type} 
                    className="mb-2" 
                    name={props.name} 
                    placeholder={props.placeholder} 
                    onChange={props.onChange} 
            />
        </div>
    );
}
